def predict(triples: list[Triple]) -> str:
    clauses = []
    for triple in triples:
        predicate = triple.predicate
        subject = triple.subject
        object_val = triple.object

        if predicate == "league":
            clauses.append(f"{subject} plays in the {object_val} league")
        elif predicate == "manager":
            clauses.append(f"{subject} is managed by {object_val}")
        elif predicate == "position":
            clauses.append(f"{subject} plays as a {object_val}")
        elif predicate == "ground":
            clauses.append(f"{subject} plays at {object_val}")
        elif predicate == "birthDate":
            clauses.append(f"{subject} was born on {object_val}")
        elif predicate == "birthPlace":
            clauses.append(f"{subject} was born in {object_val}")
        elif predicate == "birthYear":
            clauses.append(f"{subject} was born in {object_val}")
        elif predicate == "club":
            clauses.append(f"{subject} plays for {object_val}")
        elif predicate == "currentclub":
            clauses.append(f"{subject} currently plays for {object_val}")
        elif predicate == "country":
            clauses.append(f"{subject} is from {object_val}")
        elif predicate == "height":
            clauses.append(f"{subject} is {object_val} tall")
        elif predicate == "draftTeam":
            clauses.append(f"{subject} was drafted by {object_val}")
        elif predicate == "weight":
            clauses.append(f"{subject} weighs {object_val}")
        elif predicate == "activeYearsStartYear":
            clauses.append(f"{subject} started his career in {object_val}")
        elif predicate == "debutTeam":
            clauses.append(f"{subject} debuted with {object_val}")
        elif predicate == "formerTeam":
            clauses.append(f"{subject} previously played for {object_val}")
        else:
            clauses.append(f"{subject}'s {predicate} is {object_val}")

    if len(clauses) == 1:
        return clauses[0] + "."
    elif len(clauses) == 2:
        return " and ".join(clauses) + "."
    else:
        return ", ".join(clauses[:-1]) + ", and " + clauses[-1] + "."

